import React from 'react';

const TrackSearchResult = ({ track }) => {
    return (
        <div className="tracklist">
            <img src={track.albumUri} style={{height: '64px', width: '64px'}}/>
            <div>
                <p></p>{track.title}
            </div>
        </div>
    );
};

export default TrackSearchResult;
